import React, { useEffect, useState } from "react";
import { Row, Col, Container, Card, Button } from "react-bootstrap";

const ListElem = (props) => {
    console.log(new Date(props.booking.date));
    return (
        <Col xs = {3}>
        <Card className = "mb-4">
            <Card.Body>
                <Card.Title>{props.booking.serviceName}</Card.Title>
                <Card.Text>{props.booking.doctorName}</Card.Text>
                <Card.Text>{props.booking.date.replace('T', ' ').substr(0, 16)}</Card.Text>
                <Card.Text>{props.booking.price}</Card.Text>
                <Button variant="primary">Go somewhere</Button>
            </Card.Body>
        </Card>
        </Col>
    )

}

export default ListElem;
